// Antispam
function antispam() {
    $('.js-antispam').each(function (){
        var spamValue = $(this).find('input').data('value');
        
        $(this).hide();
        $(this).find('input').val(spamValue);
    });

}
// Document scroll
function documentScroll() {
	var scroll = $(window).scrollTop();

	if (scroll >= 10) {
		$('html').addClass('document-scrolled');
	} else {
		$('html').removeClass('document-scrolled');
	}

    $(window).scroll(function() {
    	var scroll = $(window).scrollTop();

	    if (scroll >= 10) {
	        $('html').addClass('document-scrolled');
	    } else {
	    	$('html').removeClass('document-scrolled');
	    }
	});
}
// Hamburger
function hamburger() {
    $('.js-hamburger a').each(function (){
		$(this).bind('click', function (e){
        	e.preventDefault();
            $('html').toggleClass('nav-open');
        });
    });
}
// Lazy images, iframes
var myLazyLoad = new LazyLoad({
    elements_selector: '.js-lazy',
    class_loading: 'is-loading', 
    class_loaded: 'is-loaded'
});

// update myLazyLoad.update();
// $('.js-slider').slick('refresh'); if is slick in hidden div

// jQuery ready
(function($) {
    // Magnific popup defaults
    $.extend(true, $.magnificPopup.defaults, {
        tClose: 'Zavřít (Esc)',
        gallery: {
            tPrev: 'Předchozí',
            tNext: 'Další',
            tCounter: '%curr% / %total%'
        }
    });

    // Lightbox gallery
    if ($('.js-lightbox').length > 1) {
        $('.js-lightbox').magnificPopup({
            mainClass: 'mfp-fade',
            removalDelay: 300,
            type: 'image',
            disableOn: 500,
            image: {
                titleSrc: 'data-lightbox-title'
            },
            gallery:{
                enabled: true
            },
            callbacks: {
                buildControls: function() {
                this.contentContainer.append(this.arrowLeft.add(this.arrowRight));
                }    
            }
        });
    } else {
        $('.js-lightbox').magnificPopup({
            mainClass: 'mfp-fade',
            removalDelay: 300,
            type: 'image',
            disableOn: 500,
            image: {
                titleSrc: 'data-lightbox-title'
            }
        });
    }

    // Lightbox gallery delegated
    $('.js-lightbox-gallery').each(function() {
        var links = $(this).find('a');

        if ($(links).length > 1) {
            $(links).magnificPopup({
                mainClass: 'mfp-fade',
                removalDelay: 300,
                type: 'image',
                disableOn: 500,
                image: {
                    titleSrc: 'data-lightbox-title'
                },
                gallery:{
                    enabled: true
                },
                callbacks: {
                    buildControls: function() {
                    this.contentContainer.append(this.arrowLeft.add(this.arrowRight));
                    }    
                }
            });
        } else {
            $(links).magnificPopup({
                mainClass: 'mfp-fade',
                removalDelay: 300,
                type: 'image',
                disableOn: 500,
                image: {
                    titleSrc: 'data-lightbox-title'
                }
            });
        }
    });

    // Dialog
	$('.js-open-dialog').magnificPopup({
	    type:'inline',
	    midClick: true,
	    mainClass: 'mfp-fade',
	    removalDelay: 300
	});

	$('.ajax-dialog').magnificPopup({
	    type:'ajax',
	    midClick: true,
	    mainClass: 'mfp-fade',
	    removalDelay: 300,
        callbacks: {
            ajaxContentAdded: function() {
                myLazyLoad.loadAll();
            }
        }
	});

	// Iframe
    $('.js-iframe').magnificPopup({
        type: 'iframe',
        mainClass: 'mfp-fade',
        removalDelay: 300,
        preloader: true
    });

    // Antispam
    antispam();

    // Hamburger
    hamburger();

    // Document scroll
    documentScroll();

    // Slider
    $('.js-slider').slick({
        accessibility: false,
        slidesToScroll: 1,
        draggable: true,
        dots: false,
        arrows: true,
        fade: false,
        speed: 300,
        appendArrows: '.slider__arrows'
    });

    $('.js-slider').on('afterChange', function(event, slick, currentSlide, nextSlide){
        myLazyLoad.update();
    });

    // History slider
    $('.js-history-slider').slick({
        accessibility: false,
        slidesToScroll: 1,
        draggable: false,
        dots: false,
        arrows: false,
        fade: false,
        speed: 500,
        touchMove: false,
        swipe: false
    });

    $('.history__year').on('click', function (e) {
        var slideIndex = $(this).data('slick-index');

        $('.history__year').removeClass('is-active');
        $(this).addClass('is-active')
        $('.js-history-slider').slick('slickGoTo', slideIndex);
    });

    $('.js-history-slider').on('afterChange', function(event, slick, currentSlide, nextSlide){
        myLazyLoad.update();
    });

    // Animation for group
    animationGroup();

    $('.js-play-video').click(function (e) {
        e.preventDefault();
        $(this).closest('.slider__fig').find('.slider__frame').addClass('is-active');
        $(this).closest('.slider__fig').find('iframe')[0].src += "?autoplay=1";
    });
    
})(jQuery);

