$(window).bind('load', function () {
    if ($('.hero').length ) {
        $('.hero__article, .hero__logo').addClass('is-active');

        setTimeout(function() { 
            $('.hero__cake').addClass('is-active');
        }, 250);
    }

    if ($('.not-found').length ) {
        $('.not-found__article, .not-found__logo').addClass('is-active');

        setTimeout(function() { 
            $('.not-found__deco').addClass('is-active');
        }, 250);
    }    
    
});